
//function is called when generate button is clicked
$('#button').click(function () {

    //creating a js pdf  
    var doc = new jsPDF();

    

    //page 1
    var imgData = 'data:image/jpeg;base64,';

    //page2
    var imgData2 = 'data:image/jpeg;base64,';
    
    
    
    
    
    
    //page3
    var imgData3 = 'data:image/jpeg;base64,';
    
    
    
    
    
    //page4
  var imgData4 = 'data:image/jpeg;base64,';


    //Adding image to pdf here 0,0 represent the cordinate of image and 210,297 represent size(here it is A4 size)
    doc.addImage(imgData, 'JPEG', 0, 0, 210, 297);

    //Accessing values from form and assigning to variables
    //first page
    var patientName = $('#patientName').val();
    var personalHealthNo= $('#personalHealthNo').val();
    var contactNo = $('#contactNo').val();
    var nic = $('#nic').val();
    var bloodGroup = $('#bloodGroup').val();
    var allergy = $('#allergy').val();
    var hospital = $('#hospital').val();
    var diseaseDescription = $('#diseaseDescription').val();
    var admissionDate = $('#admissionDate').val();
    var dischargeDate = $('#dischargeDate').val();
    var gender = $('#gender').val();
    var bht = $('#bht').val();
    var ward = $('#ward').val();
    var age = $('#age').val();
    var principalDiagnosis = $('#principalDiagnosis').val();
    var procedures = $('#procedures').val();
    var modeOfAdmission = $('#modeOfAdmission').val();
    var modeOfDischarge = $('#modeOfDischarge').val();
    var deseaseNotification = $('#deseaseNotification').val();
    var insuaranceFormFilled = $('#insuaranceFormFilled').val();
    var consultantName = $('#consultantName').val();
    var moName = $('#moName').val();
    var medicalCertificateIssued = $('#medicalCertificateIssued').val();
    
    //second page
    var deseaseDescription = $('#deseaseDescription').val();
    
    //third page
    var investigations = $('#investigations').val();
    var specialInvestigations = $('#specialInvestigations').val();
    var condition = $('#condition').val();
    
    //fourth page
    var medicationOnDischarge = $('#medicationOnDischarge').val();
    var dischargePlan = $('#dischargePlan').val();
    var followupDate= $('#followupDate').val();
    var time = $('#time').val();
    var day = $('#day').val();
    var typeOfClinic = $('#typeOfClinic').val();
    var consultantName2 = $('#consultantName2').val();
    var roomNo = $('#roomNo').val();
    var instructions = $('#instructions').val();
    var referralNotes = $('#referralNotes').val();

  
    //setting font size and color for input text 
    doc.setFontSize(12);
    doc.setTextColor('#884DFF');

    //putting the input values in specific positions of image/pdf by specifying co-ordinate

    //first page
    doc.addImage(imgData, 'JPEG', 0, 0, 210, 297);

    doc.text(35, 90, patientName);
    doc.text(170, 9, personalHealthNo);
    doc.text(170, 26, contactNo);
    doc.text(170, 42, nic);
    doc.text(170, 57, bloodGroup);
    doc.text(170, 76, allergy);
    doc.text(31, 76, hospital);
    //doc.text(23, 170, diseaseDescription);
    doc.text(40, 130, admissionDate);
    doc.text(150, 130, dischargeDate);
    doc.text(156, 115, gender);
    doc.text(40, 110, bht);
    doc.text(105, 110, ward);
    doc.text(190, 110, age);
    doc.text(60, 154, principalDiagnosis);
    doc.text(60, 180, procedures);
    doc.text(100, 218, modeOfAdmission);
    doc.text(100, 240, modeOfDischarge);
    doc.text(70, 263, deseaseNotification);
    doc.text(70, 291, insuaranceFormFilled);
    doc.text(70, 276, medicalCertificateIssued);
    doc.text(155, 262, consultantName);
    doc.text(155, 280, moName);

    //second page
    doc.addPage(210,297);
    doc.addImage(imgData2, 'JPEG', 0, 0, 210, 297);
    
    doc.text(10, 40, diseaseDescription);

    //third page
    doc.addPage(210,297);
    doc.addImage(imgData3, 'JPEG', 0, 0, 210, 297);

    doc.text(10, 40, investigations);
    doc.text(10, 190, specialInvestigations);
    doc.text(10, 270, condition);

    //fourth page
    doc.addPage(210,297);
    doc.addImage(imgData4, 'JPEG', 0, 0, 210, 297);

    doc.text(10, 30, medicationOnDischarge);
    doc.text(10, 112, dischargePlan);
    doc.text(2, 175, followupDate);
    doc.text(37, 175, day);
    doc.text(66, 175, time);
    doc.text(100, 175, typeOfClinic);
    doc.text(145, 175, consultantName2);
    doc.text(193, 175, roomNo);
    doc.text(10, 200, instructions);
    doc.text(10, 230, referralNotes);


    //Saving pdf in required name
    doc.save('Diagnosis Card.pdf');

    clearForm()

});
